interface TextProps {
    /**
    * What is the type of text?
    */
    type: "h1" | "h2" | "h3" | "h4" | "p";
    /**
     * What is the content?
     */
    content?: string;
}

export const Text = ({
    type,
    content,
    ...props
}: TextProps) => {
    switch (type) {
        case "h1": 
        return <h1 {...props}>{content}</h1>;
        case "h2": 
        return <h2 {...props}>{content}</h2>;
        case "h3": 
        return <h3 {...props}>{content}</h3>;
        case "h4": 
        return <h4 {...props}>{content}</h4>;
        case "p": 
        return <p {...props}>{content}</p>;
    }
};
